import './App.css';

function App() {
  return (
    <>
    <div className="App-header">
      <img src={logo} alt="logo" />
      <h1>School dashboard</h1>
      <div className="App-body">
        <p>Login to access the full dashboard</p>
        <div className="App-footer">
          <p>Copyright 2020 - holberton School</p>
        </div>
      </div>
    </div>
    </>
  )
}

export default App;
